import React from "react";
import Task_cmp from "./Task_cmp";

export default class Column_cmp extends React.Component {
  render() {
    return (
      <section>
        {this.props.tasks.map((task) => (
          <Task_cmp key={task.id} task={task} />
        ))}
      </section>
    );
  }
}
